import { useContext } from "react";
import { DataContext } from "../App"

function Score(){
    const {score} = useContext(DataContext);
    return(
        <div className="score">
            <h1>Result Summary</h1>
            <h2>{score}</h2>
        </div>
    )
}

export default Score
